<!DOCTYPE html>
<html lang="en">
<head>
	<meta charset="UTF-8">
	<meta name="viewport" content="width=device-width, initial-scale=1.0">
	<title>Document</title>

	<script>
		"use strict";

		var arr = [5, 4, 3, true, 'hello'];
		for (let item of arr) {
			console.log(item);
		};


		var map = new Map([["alex", "hah"], ["ethan", 11], ["sandro", 21]]);
		for (let i of map) {
			console.log(i);
		}


		var set = new Set([0, 9, 8, false, "hah"]);
		for (let item of set) {
			console.log(item)
		}

	</script>
</head>

</body>
</html>
